import React, { Component } from 'react';
import Logo from '../logo/Logo';
import './userpage.css'

class UserPage extends Component{
	constructor(){
		super();
		this.state = {
			types: [],
			typetoadd: '',
			descrition: '',

		}
	}

	componentDidMount(){
		  fetch('http://localhost:3001/type')
		  .then(res => res.json())
		  .then(types => {
		  	this.setState({types:types})
		  })
	}


		onChangeSelectionType = (e) =>{
			this.setState({
							typetoadd: e.target.outerText

						});
			console.log(this.state.typetoadd);
			console.log(e.target.outerText);

		}

	render(){
		const  types = this.state.types;
		return(
			<div className = 'upage'>
			   <div className = 'nav'>
					<div className = 'user'>
						<div className = 'log'>
							<Logo />
						</div>
					</div>
				</div>

				<div className = 'selection'>
				    <div className = ' selection-box'>
				      <div>
							  {
							  	types.map((type, i) =><li key={i}>
							  		<div  onClick = {this.onChangeSelectionType}>{type.value}
							  		</div>
							  		</li>)
							  }
		                </div>
		                <div>
						  <ul>
						  	<li>Adult</li>
						  	<li>Children</li>
						  </ul>
						</div>
					    <div>
						  <ul>
						  	<li>VIP "$300"</li>
						  	<li>NORMAL</li>
						  </ul>
						</div>
					</div>

					<div className = 'submit'>
					   <input type = 'submit' className="b ph3 pv2 input-reset ba b--white bg-transparent grow pointer white f6 dib"/>
					</div>
				</div>

				<div className = 'coments-box'>
				<input className = 'input b ph3 pv2 input-reset ba b--white bg-transparent grow pointer white f6 dib' 
				       type = 'text' placeholder = 'This where you will dicribe your decided hair cut' />
				<div className = 'coments-box--box'></div>

				</div>


			</div>
			);
	}
}
export default UserPage;
